import React from 'react'
import { useState } from "react";


const sideNav = ({ links, switchContent, activeLink }) => {
  return (
    <div className="side-nav">
      {links.map(link => (
        <a 
          key={link.id} 
          href="#" 
          onClick={() => switchContent(link.id)}
          className={activeLink === link.id ? 'active' : ''}
        >
          {link.text}
        </a>
      ))}
    </div>
  );
}

export default Nav;
